import React from 'react';
import Logo from '../../assets/img/Logo.png';
import './Menu.css';

export default function Menu (){
  return (
    <nav>
      <a href="../../index.js">
        <img className="Logo" src={Logo} alt="HackFlix Logo"/>
      </a>
    </nav>
  );
}
